import Nav from '../components/Nav';
import Pocket from '../components/Pocket';
import LinkedIn from '../img/linkedin.png';
import Email from '../img/email.png';

function Homepage() {

    return (
        <div className="container">
            <div className="columns">
                <div className="col content"> 
                    {/* <img src={feet} className="feet"></img> */}
                </div>
                <div className="col content">

                </div>
                <div className="col content">
                    <a href="mailto:ib.bashir@hotmail.com"><img class="contact" src={Email} height="200px" width="200px"/></a>
                    <a href="https://uk.linkedin.com/in/ibrahim-bashir-250953197"><img class="contact" src={LinkedIn} height="200px" width="200px"/></a>	
                </div>
            </div>
            <Nav></Nav>
        </div>
    )
}


export default Homepage;
